import React, {useContext} from 'react';
import { GlobalContext } from '../context/GlobalState';

export const Foods = ({ foods }) => {
    const { deleteFoods } = useContext(GlobalContext);

  return (
    <li className="fooditem">
        {foods.text} <span>{foods.amount}g</span><button
        onClick={() => deleteFoods(foods.id)} className="delete-btn">x</button>
    </li>
  )
}
